('2021-02-21 08:38:25', 'EVT20171103007', 'Himpunan Mahasiswa Sistem Informasi', 'Workshop Flask Framework Python', '2017-11-03', '2017-11-04', '08:00', '15:00', 'Lab. Jaringan Komputer Universitas Nasional', 'Workshop', 'Berbayar', 35, 'workshop-pyhton.png', 'Himpunan Mahasiswa Sistem Informasi (HIMASI) Universitas Nasional menyelenggarakan workshop flash framework Python, Jumat-Sabtu, (3-4/11). Bertempat di Laboratorium Jarkom UNAS, kegiatan ini diikuti oleh mahasiswa dari program studi sistem informasi dan teknik informatika UNAS.Workshop ini lebih ke arah fundamental bahasa program Python. Memang sekarang ini Python menjadi kebutuhan para Information Technology (IT) di Indonesia khususnya mahasiswa IT,” ujar salah satu anggota HIMASI, Novindra Prasetyo.\r\n', '<ol> 													<li>Peserta hanya dapat memesan satu event dengan satu akun email yang terdaftar</li> 													<li>Peserta disarankan datang tepat waktu di hari H.</li> 													<li>Untuk tiket berbayar peserta harus menunggu validasi pembayaran tiket oleh panitia.  </li> 												</ol>', 'Selesai', 'Tidak'),
('2021-02-21 08:38:53', 'EVT20180125006', 'Himpunan Mahasiswa Sistem Informasi', 'MTA Database Fundamental', '2018-01-25', '2018-01-27', '08:00', '15:00', 'Lab. Jaringan Komputer Universitas Nasional', 'Pelatihan', 'Berbayar', 40, 'mta-database3.png', 'Overview: ●	Understand Core Database Consepts\r\n●	Create Database Objects\r\n●	Manipulate Data\r\n●	Understand Data Storage\r\n●	Administer a Database\r\n', '<ol> 													<li>Peserta hanya dapat memesan satu event dengan satu akun email yang terdaftar</li> 													<li>Peserta disarankan datang tepat waktu di hari H.</li> 													<li>Untuk tiket berbayar peserta harus menunggu validasi pembayaran tiket oleh panitia.  </li> 												</ol>', 'Selesai', 'Tidak'),
('2021-02-21 08:39:28', 'EVT20180316005', 'Himpunan Mahasiswa Sistem Informasi', 'Building Your Career With Data Science', '2018-03-16', '2018-03-16', '08:00', '14:00', 'Aula Blok 1 Lt IV Universitas Nasional', 'Seminar', 'Berbayar', 175, 'datascience1.png', 'Fakultas Teknologi Komunikasi dan Informatika (FTKI) melalui Himpunan Mahasiswa Sistem Informasi (HIMASI) menggelar seminar bertajuk “Building Your Career With Data Science” pada jumat (17/3) di Aula Blok 1 lantai 4 Universitas Nasional (UNAS).  Acara ini bertujuan memberikan motivasi kepada mahasiswa  serta masyarakat umum untuk memanfaatkan peluang yang ada dalam pembangunan maupun peluang karir, dengan harapan mampu membuat para pelaku termotivasi untuk bekerjasama  dalam mengembangkan data science di Indonesia.\r\n', '<ol> 													<li>Peserta hanya dapat memesan satu event dengan satu akun email yang terdaftar</li> 													<li>Peserta disarankan datang tepat waktu di hari H.</li> 													<li>Untuk tiket berbayar peserta harus menunggu validasi pembayaran tiket oleh panitia.  </li> 												</ol>', 'Selesai', 'Tidak'),
('2021-02-21 08:40:19', 'EVT2019073004', 'Himpunan Mahasiswa Sistem Informasi', 'Introduction For Big Data', '2019-07-30', '2019-07-30', '08:00', '14:00', 'Aula Blok 1 Lt IV Universitas Nasional', 'Seminar', 'Berbayar', 200, 'bigdata.png', 'Acara seminar nasional dengan tema \"Introduction For Big Data\" ini ditujukan untuk memberikan pembekalan diri kepada mahasiswa terkait dengan penggunaan big data. Agar nantinya dapat diimplementasikan di dunia kerja. Selain daripada itu juga sebagai pemenuhan syarat SKPI (Surat Keterangan Pendamping Ijazah) bagi para mahasiswa.', '<ol> 													<li>Peserta hanya dapat memesan satu event dengan satu akun email yang terdaftar</li> 													<li>Peserta disarankan datang tepat waktu di hari H.</li> 													<li>Untuk tiket berbayar peserta harus menunggu validasi pembayaran tiket oleh panitia.  </li> 												</ol>', 'Selesai', 'Tidak'),
