('2020-10-08 10:17:25', 'EVT2020077003', 'Himpunan Mahasiswa Sistem Informasi', 'Webinar \"How to be a Data Analyst\"', '2020-09-22', '2020-09-22', '10:00', '13:10', 'Zoom Meeting Platform', 'Seminar', 'Gratis', 800, 'webinar-data-2020.jpg', '<strong>\r\n HIMPUNAN MAHASISWA SISTEM INFORMASI UNIVERSITAS NASIONAL </br>\r\nProudly Present : </br>\r\n</br>\r\nWEBINAR\r\n\"How to be A Data Analyst\"</br></strong>\r\n</br>\r\nHalo sobat online yang kece dan terupdate, yuk ikut WEBINAR untuk menambah ilmu dan wawasan tentang Data Analyst\r\n</br>\r\nHold on :</br>\r\n<span class=\"fa fa-calendar\"></span> Hari/Tanggal : Selasa, 22 September 2020</br>\r\n<span class=\"fa fa-clock-o\"></span> Waktu : 10.00 AM - 13.10 PM <br>\r\n<span class=\"fa fa-marker\"></span> Via : Zoom Meeting Platform</br> </br>\r\n<span class=\"fa fa-money-bill-alt\"></span> HTM : FREE</br> \r\nBenefits : </br>\r\n- E-Certificate  </br>\r\n<small>*untuk 200 pendaftar pertama</small><br>\r\n- Usefull Knowledge</br>\r\n- Doorprize Voucher LINKAJA</br>\r\n<br>\r\nSyarat mendapatkan sertifikat:</br>\r\n- Wajib follow akun Instagram <a href=\"https://www.instagram.com/himasi.unas1949/\">@himasi.unas1949</a></br>\r\n- Wajib hadir dan mengisi form kehadiran di acara webinar. <br>\r\n</br> Speakers :</br>\r\n1. Dr. Andry Alamsyah, S.Si, M.Sc</br>\r\n(Director of Digital Business Ecosytem Research Center, Telkom University)</br>\r\n2. Ryan Andhika Perdana, M.B.A.</br>\r\n(Data Scientist at Digital Service Division PT Telekomunikasi Indonesia Tbk)</br>\r\n</br>\r\n Moderator :</br>\r\n1. Dr. Fauziah, S.Kom., MMSI.(Ketua ICT Research Center FTKI UNAS)</br>\r\n</br>\r\n*Pendaftaran*</br>\r\n<span class=\"fa fa-calendar\"></span> 3 September 2020 - 21 September 2020\r\n</br></br>\r\n\r\nTopik : <br>\r\n1. Pengenalan data analyst<br>\r\n2. Step yg harus dilakukan untuk menjadi data analyst<br>\r\n3. Skill yg dibutuhkan dalam data analyst<br>\r\n4. Ruang lingkup kerja data analyst<br>\r\n5. Tips and trick menjadi seorang data analyst<br>\r\n6. Contoh problem solving pada permasalahan data analyst<br>\r\n<br>\r\nSusunan Acara :<br>\r\n 1. Registrasi : 09:40 - 10:00<br>\r\n 2. Menyanyikan Lagu Indonesia Raya : 10:00 - 10:05<br>\r\n 3. Sambutan & Pembukaan : 10:05 - 10:20<br>\r\n 4. Penyampaian Materi Pembicara 1 (Dr. Andry Alamsyah, S.Si, M.Sc) : 10:20 - 11:20<br>\r\n 5. Persentasi dari Codex :  11:20 - 11:25<br>\r\n 6. Penyampaian Materi Pembicara 2 (Ryan Andhika Perdana, M.B.A.) : 11:25 - 12:25<br>\r\n 7. Diskusi & Tanya Jawab : 12:25 - 12:55<br>\r\n 8. Penutupan, Doorprize, dan Foto Bersama : 12:55 - 13:10 <br>\r\n<br>\r\n*Link Zoom akan dikirimkan melalui email pada H-1 Acara.<br>\r\n</br><br>\r\n MORE INFORMATION :</br>\r\nAkbar (+62 857-7770-3454)</br>\r\nBudi (+62 882-1082-9521) </br>\r\n</br>\r\nFollow us on social media</br>\r\nInstagram : <a href=\"https://www.instagram.com/himasi.unas1949/\">@himasi.unas1949</a></br>\r\nOA LINE : <a href=\"https://lin.ee/S1usGrm\">https://lin.ee/S1usGrm</a><br>\r\nWebsite : <a href=\"https://himasi.ftki.unas.ac.id/\">himasi.ftki.unas.ac.id</a><br>', '<ol> 													<li>Peserta hanya dapat memesan satu event dengan satu akun email yang terdaftar</li> 													<li>Peserta disarankan datang tepat waktu di hari H.</li> 													<li>Untuk tiket berbayar peserta harus menunggu validasi pembayaran tiket oleh panitia.  </li> 												</ol>', 'Selesai', 'Iya'),
